<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
  </head>

  <body>
    
    <div ng-include="headerInclude"></div>
    <div ng-controller="Apiman.Error409Controller" class="container error-page" data-field="error-page">
      <div class="row">
        <div class="col-md-3">
          <div class="error-icon error-409 pull-right"></div>
        </div>
        <div class="col-md-8">
          <div class="title" apiman-i18n-key="error-409-title">Already Exists</div>
          <div class="description" apiman-i18n-key="error-409-description">You've just tried to create something that already exists!  Maybe try again with a different name?</div>
        </div>
      </div>
    </div>
  </body>
</html>
